	background-color: transparent; 
}

self .selected .matrixMeetingItem{ 
	border: 1px solid #5FB2F9;
}

self .selected .matrixMeetingItem:has(p span[title="remote"]){ 
	border: 1px solid #7EC9C9;
}

self .selected .matrixMeetingItem:has(p span[title="hybrid"]){ 
	border: 1px solid #705FB5;
}

self{
	cursor: pointer;
	padding-left: 40px;
	padding-right: 40px;
	color: #5FB2F9 !important;
	border-color: #5FB2F9 !important;
}
self:has(p span[title="remote"]){ 
	color: #7EC9C9 !important;
	border-color: #7EC9C9 !important;
}

self:has(p span[title$="(hybrid)"]){ 
	color: #705FB5 !important;
	border-color: #705FB5 !important;
}

@media screen and (max-width: 1000px) {
  self{
    padding-left: 5px;
	padding-right: 5px;
	font-size:14px;
  }
}

self {
	display: -webkit-box;
	-webkit-line-clamp: 1;
	-webkit-box-orient: vertical;
	overflow: hidden;
}

self { 
	position: absolute;
	display: none;
	background-color: #f1f1f1; 
